import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Form, Button, Card } from 'react-bootstrap';
import axios from 'axios';

function SalaryEstimator() {
    const [roles, setRoles] = useState([]);
    const [industries, setIndustries] = useState([]);
    const [locations, setLocations] = useState([]);
    const [experience, setExperience] = useState('');
    const [selectedRole, setSelectedRole] = useState('');
    const [selectedIndustry, setSelectedIndustry] = useState('');
    const [selectedLocation, setSelectedLocation] = useState('');
    const [salaryEstimate, setSalaryEstimate] = useState(null);

    // Fetch roles, industries, and locations from jobRoutes
    useEffect(() => {
        const fetchOptions = async () => {
            try {
                const response = await axios.get('http://localhost:5000/api/jobs/options');
                setRoles(response.data.roles);
                setIndustries(response.data.industries);
                setLocations(response.data.locations);
            } catch (error) {
                console.error('Error fetching options:', error);
            }
        };

        fetchOptions();
    }, []);

    const handleEstimateSalary = async () => {
        try {
            const response = await axios.get('http://localhost:5000/api/jobs/estimate-salary', {
                params: {
                    role: selectedRole,
                    industry: selectedIndustry,
                    location: selectedLocation,
                    experience: experience,
                },
            });
            setSalaryEstimate(response.data);
        } catch (error) {
            console.error('Error estimating salary:', error);
        }
    };

    return (
        <Container fluid className="p-4">
            <Row>
                <Col xs={12} md={6} className="mb-4">
                    <Form>
                        <Form.Group controlId="formRole">
                            <Form.Label>Role</Form.Label>
                            <Form.Control
                                as="select"
                                value={selectedRole}
                                onChange={(e) => setSelectedRole(e.target.value)}
                            >
                                <option value="">Select role</option>
                                {roles.map((role) => (
                                    <option key={role} value={role}>{role}</option>
                                ))}
                            </Form.Control>
                        </Form.Group>
                        <Form.Group controlId="formIndustry">
                            <Form.Label>Industry</Form.Label>
                            <Form.Control
                                as="select"
                                value={selectedIndustry}
                                onChange={(e) => setSelectedIndustry(e.target.value)}
                            >
                                <option value="">Select industry</option>
                                {industries.map((industry) => (
                                    <option key={industry} value={industry}>{industry}</option>
                                ))}
                            </Form.Control>
                        </Form.Group>
                        <Form.Group controlId="formLocation">
                            <Form.Label>Location</Form.Label>
                            <Form.Control
                                as="select"
                                value={selectedLocation}
                                onChange={(e) => setSelectedLocation(e.target.value)}
                            >
                                <option value="">Select location</option>
                                {locations.map((location) => (
                                    <option key={location} value={location}>{location}</option>
                                ))}
                            </Form.Control>
                        </Form.Group>
                        <Form.Group controlId="formExperience">
                            <Form.Label>Experience (years)</Form.Label>
                            <Form.Control
                                type="number"
                                value={experience}
                                onChange={(e) => setExperience(e.target.value)}
                                min="0"
                            />
                        </Form.Group>
                        <Button variant="primary" onClick={handleEstimateSalary}>
                            Estimate Salary
                        </Button>
                    </Form>
                </Col>
                <Col xs={12} md={6}>
                    {salaryEstimate && (
                        <Card className="mt-4">
                            <Card.Body>
                                <Card.Title>Salary Estimate</Card.Title>
                                <Card.Text>
                                    <strong>Minimum Salary:</strong> ${salaryEstimate.minSalary}<br />
                                    <strong>Maximum Salary:</strong> ${salaryEstimate.maxSalary}
                                </Card.Text>
                            </Card.Body>
                        </Card>
                    )}
                </Col>
            </Row>
        </Container>
    );
}

export default SalaryEstimator;
